import axios from 'axios';


export const getProducts = () => {
    return axios("https://yalantis-react-school-api.yalantis.com/api/v1/products" +
        "page=" + page + 
        "&perPage=" + perPage + 
        "&origins=" + origins + 
        "&minPrice=" + minPrice + 
        "&maxPrice=" + maxPrice
    )
}
